//Routing.js-Module
import React from 'react'

//component_Nesting_into_Routings
import Header from'./mainmenu/Header.js'
import Footer from'./mainmenu/Footer.js'
import Home from'./mainmenu/Home.js'
import About from'./mainmenu/About.js'
import Services from'./mainmenu/Services'
import Contact from'./mainmenu/Contact.js'
import { BrowserRouter,Router  } from 'react-router-dom';


//Routing_setup
function Routings(){

    return(<BrowserRouter>

          <Header/>

       
       <Router  excat path="/" component={Home} />

       <Router path="/home" component={Home} />
       
       <Router path="/about" component={About} />

       <Router path="/contact" component={Contact} />

       <Router path="/services" component={Services} />

       <Footer/>
 
      
    </BrowserRouter>)
}
export default Routings;
